var title_f19_43_20146="Mechanism of acute pain";
var content_f19_43_20146=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F74589&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F74589&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Mechanism of acute pain",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 398px; height: 532px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Tissue injury leads to release of inflammatory mediators with subsequent nociceptor stimulation. Pain impulses are then transmitted to the dorsal horn of the spinal cord, where they make contact with second-order neurons that cross to the opposite side of the cord and ascend via the spinothalamic tract to the reticular activating system (RAS) and thalamus. The localization and meaning of pain occurs at the level of the somatosensory cortex.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Wolters Kluwer. Copyright &copy;2008.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
