var title_f19_43_20155="Options breast ovar ca PI";
var content_f19_43_20155=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PI%2F69530&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PI%2F69530&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Estimated impact of different combinations of options on breast and ovarian cancer risk in women with inherited genetic mutations",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\" colspan=\"1\" rowspan=\"2\">",
"       Option combination",
"      </td>",
"      <td class=\"subtitle1\" colspan=\"2\" rowspan=\"1\">",
"       Percent risk decrease",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2\">",
"       Breast cancer",
"      </td>",
"      <td class=\"subtitle2\">",
"       Ovarian cancer",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Prophylactic mastectomy and BSO before age 40",
"      </td>",
"      <td>",
"       &gt;90",
"      </td>",
"      <td>",
"       ~90",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       BSO before age 40 and tamoxifen",
"      </td>",
"      <td>",
"       ~85",
"      </td>",
"      <td>",
"       ~95",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       BSO before age 40 and breast cancer screening",
"      </td>",
"      <td>",
"       40 to 50",
"      </td>",
"      <td>",
"       ~95",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Breast cancer screening and ovarian cancer screening*",
"      </td>",
"      <td>",
"       0",
"      </td>",
"      <td>",
"       0",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     BSO: bilateral salpingooophorectomy.",
"     <br>",
"      * Screening does not affect the risk of developing cancer but may affect the risk of dying from the cancer by detecting it early. Screening for ovarian cancer is difficult and has not been shown to affect the risk of dying of ovarian cancer. Breast cancer screening saves lives in women with average risk of breast cancer but has not been studied enough in women with genetic mutations to determine its effect on breast cancer mortality.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
