var title_f19_43_20156="Risk primary brain tumors";
var content_f19_43_20156=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F69121&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F69121&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Factors studied in relationship to risk of primary brain tumors of neuroepithelial tissue or meninges",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Hereditary syndromes*: tuberous sclerosis, neurofibromatosis types 1 and 2,",
"nevoid basal cell carcinoma syndrome, and adenomatous",
"polyposis syndromes, Li-Fraumeni cancer family syndrome (inherited p53",
"mutations).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Family history of brain tumors",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Constitutive",
"polymorphisms  in glutathione transferases, cytochrome p450 2D6 and",
"1A1, N-acetyltransferase, ERCC1 and ERCC2, other",
"carcinogen metabolizing, DNA repair, and immune function genes.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Lymphocyte mutagen sensitivity to gamma radiation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Prior cancers",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Infectious agents or immunologic response:  viruses (common colds, influenza, varicellazoster virus, BK virus, JC",
"virus, others), Toxoplasma gondii",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Allergies",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Head trauma",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Epilepsy, seizures, or convulsions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Drugs and medications",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Diet and vitamins: nitrosamine/nitrosamide/nitrate/nitrite consumption,",
"cured foods, calcium, food frequency",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Tobacco smoke exposures",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Alcohol",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hair dyes and hairsprays",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Traffic-related air pollution",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Occupations",
"and industries:  synthetic rubber manufacturing, vinyl chloride,",
"petroleum refining/production work, licensed",
"pesticide applicators, agricultural work, others (see text), parental",
"workplace exposures",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ionizing radiation: therapeutic*; diagnostic and other sources",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cellular telephones",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Other radiofrequency exposures",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Lower frequency",
"electromagnetic field",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     ERCC2: Excision repair cross complementation group 2 gene, complementation group 2 (xerodema pigmentosum D).",
"     <br>",
"      * These are the only factors that have been proven to cause primary brain tumors of neuroepithelial tissue or meninges. Evidence for or against associations of other factors is presented in the text.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Wrensch, M, Minn, Y, Chew, T, et al. Epidemiology of primary brain tumors: Current concepts and review of the literature. Neuro-Oncology 2002; 4:278. Copyright &copy; 2002 Margaret Wrensch, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f19_43_20156=[""].join("\n");
var outline_f19_43_20156=null;
var title_f19_43_20157="Lung cancer TMN staging 6th edition";
var content_f19_43_20157=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F74820&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F74820&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    AJCC TNM staging system for lung cancer (6th edition, 2002)",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1_single\" colspan=\"4\">",
"       Primary tumor (T)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       T1",
"      </td>",
"      <td colspan=\"3\">",
"       Tumor &le;3 cm diameter without invasion more proximal than lobar bronchus",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"4\">",
"       T2",
"      </td>",
"      <td class=\"sublist1_start\" colspan=\"3\">",
"       Tumor &gt;3 cm diameter",
"       <strong>",
"        OR",
"       </strong>",
"       Tumor of any size with any of the following:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\" colspan=\"3\">",
"       Invades visceral pleura",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\" colspan=\"3\">",
"       Atelectasis of less than entire lung",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\" colspan=\"3\">",
"       Proximal extent at least 2 cm from carina",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"5\">",
"       T3",
"      </td>",
"      <td class=\"sublsit1_start\" colspan=\"3\">",
"       Tumor of any size with any of the following:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\" colspan=\"3\">",
"       Invasion of chest wall",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\" colspan=\"3\">",
"       Involvement of diaphragm, mediastinal pleura, or pericardium",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\" colspan=\"3\">",
"       Atelectasis involving entire lung",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\" colspan=\"3\">",
"       Proximal extent within 2 cm of carina",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"7\">",
"       T4",
"      </td>",
"      <td class=\"sublist1_start\" colspan=\"3\">",
"       Tumor of any size with any of the following:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\" colspan=\"3\">",
"       Invasion of mediastinum",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\" colspan=\"3\">",
"       Invasion of heart or great vessels",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\" colspan=\"3\">",
"       Invasion of trachea or esophagus",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\" colspan=\"3\">",
"       Invasion of vertebral body or carina",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\" colspan=\"3\">",
"       Presence of malignant pleural or pericardial effusion",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\" colspan=\"3\">",
"       Satellite tumor nodule(s) within same lobe as primary tumor",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\" colspan=\"4\">",
"       Nodal involvement (N)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       N0",
"      </td>",
"      <td colspan=\"3\">",
"       No regional node involvement",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       N1",
"      </td>",
"      <td colspan=\"3\">",
"       Metastasis to ipsilateral hilar and/or ipsilateral peribronchial nodes",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       N2",
"      </td>",
"      <td colspan=\"3\">",
"       Metastasis to ipsilateral mediastinal and/or subcarinal nodes",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       N3",
"      </td>",
"      <td colspan=\"3\">",
"       Metastasis to contralateral mediastinal or hilar nodes",
"       <strong>",
"        OR",
"       </strong>",
"       ipsilateral or contralateral scalene or supraclavicular nodes",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\" colspan=\"4\">",
"       Metastasis (M)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       M0",
"      </td>",
"      <td colspan=\"3\">",
"       Distant metastasis absent",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       M1",
"      </td>",
"      <td colspan=\"3\">",
"       Distant metastasis present (includes metastatic tumor nodules in a different lobe from the primary tumor)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\" colspan=\"4\">",
"       Stage groupings of TNM subsets",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Stage IA",
"      </td>",
"      <td>",
"       T1",
"      </td>",
"      <td>",
"       N0",
"      </td>",
"      <td>",
"       M0",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Stage IB",
"      </td>",
"      <td>",
"       T2",
"      </td>",
"      <td>",
"       N0",
"      </td>",
"      <td>",
"       M0",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Stage IIA",
"      </td>",
"      <td>",
"       T1",
"      </td>",
"      <td>",
"       N1",
"      </td>",
"      <td>",
"       M0",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"2\">",
"       Stage IIB",
"      </td>",
"      <td>",
"       T2",
"      </td>",
"      <td>",
"       N1",
"      </td>",
"      <td>",
"       M0",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       T3",
"      </td>",
"      <td>",
"       N0",
"      </td>",
"      <td>",
"       M0",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\" rowspan=\"2\">",
"       Stage IIIA",
"      </td>",
"      <td>",
"       T3",
"      </td>",
"      <td>",
"       N1",
"      </td>",
"      <td>",
"       M0",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       T1-3",
"      </td>",
"      <td>",
"       N2",
"      </td>",
"      <td>",
"       M0",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\" rowspan=\"2\">",
"       Stage IIIB",
"      </td>",
"      <td>",
"       Any T",
"      </td>",
"      <td>",
"       N3",
"      </td>",
"      <td>",
"       M0",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       T4",
"      </td>",
"      <td>",
"       Any N",
"      </td>",
"      <td>",
"       M0",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Stage IV",
"      </td>",
"      <td>",
"       Any T",
"      </td>",
"      <td>",
"       Any N",
"      </td>",
"      <td>",
"       M1",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: AJCC Cancer Staging Manual, 6th edition, New York, 2002.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
